import React,{useState,useEffect} from "react";
import '../styles/dashboard.css';
import '../styles/global.css';
import axios from 'axios';


const Catalog = () =>{
    const [products, setProducts] = useState([]);

    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const response = await axios.get(`http://localhost:5000/api//profile`,); // Adjust the endpoint as necessary
                setProducts(response.data);
            } catch (error) {
                console.error('Ошибка при загрузке продуктов:', error);
                setError('Ошибка при загрузке продуктов');
            } finally {
                setLoading(false);
            }
        };

        fetchProducts();
    }, []);

    return(
        <main> {/* Каталог */}
          <div className="catalog-container">
            <div className="title-primary">Каталог</div>
            <div className="catalog">
              <div className="card-catalog">
                <div className="card-img"></div>
                <div className="card-title">Краска для кузова</div>
                <div className="card-subtitle">Краски для кузова автомобиля предназначены для защиты кузова от внешних воздействий,
                   таких как солнечный свет, дождь, грязь и пыль</div>
                <div className="card-price">1000 руб</div>
                <button className='card-btn'> Купить </button>
              </div>
              <div className="card-catalog">
                <div className="card-img"></div>
                <div className="card-title">Краска для кузова</div>
                <div className="card-subtitle">Краски для кузова автомобиля предназначены для защиты кузова от внешних воздействий,
                   таких как солнечный свет, дождь, грязь и пыль</div>
                <div className="card-price">1000 руб</div>
                <button className='card-btn'> Купить </button>
              </div>
              <div className="card-catalog">
                <div className="card-img"></div>
                <div className="card-title">Краска для кузова</div>
                <div className="card-subtitle">Краски для кузова автомобиля предназначены для защиты кузова от внешних воздействий,
                   таких как солнечный свет, дождь, грязь и пыль</div>
                <div className="card-price">1000 руб</div>
                <button className='card-btn'> Купить </button>
              </div>
              <div className="card-catalog">
              {products.length === 0 ? (
                  <p>Нет доступных продуктов.</p>
                ) : (
                  products.map((product) => (
                    <div key={product.id} className="card-catalog">
                      {/* Изображение продукта */}
                      <div
                        className="card-img"
                        style={{
                          backgroundImage: `url(${product.imageUrl})`,
                          backgroundSize: "cover",
                          backgroundPosition: "center",
                        }}
                      ></div>

                      {/* Название продукта */}
                      <div className="card-title">{product.name}</div>

                      {/* Описание продукта */}
                      <div className="card-subtitle">{product.description}</div>

                      {/* Цена продукта */}
                      <div className="card-price">{product.price} руб</div>

                      {/* Кнопка покупки */}
                      <button className="card-btn">Купить</button>
                    </div>
                  ))
                )}
              </div>
              
              
            </div>
          </div>
        </main>
    )
}

export default Catalog;
